import React from "react";
import { Link } from "react-router-dom";
  
const Goto = () => {
  return (
    <div>
      <br />
      <ul>
        <li>
          <Link to="/user">User</Link>
        </li>
        <li>
          <Link to="/homeunion">Home union</Link>
        </li>
      </ul>
    </div>
  );
};
  
export default Goto;
